import React from 'react';
import Grid from '@material-ui/core/Grid';
import house from '../../house.png';

const Types = () => (
  <div className="App">
  <header className="App-header" style={{ textAlign: 'left', fontWeight: 'bold' }}>
    <h1 className="header-med house-header-2">The types</h1>
  </header>
  <img src={house} className="App-logo" alt="logo" />

</div>
)
export default Types;
